import React, { useState, useEffect } from "react";
import axios from "axios";

const NasaData = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("https://api.nasa.gov/planetary/apod?api_key=DXBQYURclilUvzMMFtqkNSGd76tYlshUTVEq8efN").then((response) => {
      setData(response.data);
    });
  }, []);

  return (
    <div>
      {data.map((item) => (
        <div key={item.id}>
          <h1>{item.title}</h1>
          <img src={item.url} />
          <p>{item.description}</p>
        </div>
      ))}
    </div>
  );
};

export default NasaData;
